webpackJsonp([0xe98d3040cd5c],{8951:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"She Doesn't Fly Anymore",date:"03 Mar 2008",slug:"/2008-03-03-she-doesnt-fly-anymore/",tags:"Y2008"},html:'<p>In her managerial career I bet Frauke flew over a hundred times to Munich and back, and experienced many rough landings. But nothing like <a href="http://www.liveleak.com/view?i=ddb_1204404185">this Lufthansa flight</a> from Munich landing in Hamburg this past weekend, yet another reason to be thankful she now stays close to home. (Via <a href="http://sprechblase.wordpress.com/2008/03/02/approaching-hamburg-airport/">Cem</a> and <a href="http://vowe.net/archives/009234.html">Volker</a>)</p>\n<p><embed src="http://www.liveleak.com/player.swf" width="450" height="370" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" flashvars="autostart=false&token=ddb_1204404185" scale="showall" name="index"></embed></p>'},next:{fields:{title:"We Need The Eggs",date:"01 Mar 2008",slug:"/2008-03-01-we-need-the-eggs/"}},previous:{fields:{title:"Vandalism",date:"10 Mar 2008",slug:"/2008-03-10-vandalism/"}}},{node:{fields:{title:"We Need The Eggs",date:"01 Mar 2008",slug:"/2008-03-01-we-need-the-eggs/",tags:"Y2008"},html:'<p>My Text Link Ads are booked out again, so I guess the reports that changes in Google had killed such advertising were greatly exaggerated. PayPal has already sent a notice that my balance is too high for personal use.</p>\n<p>Earning money from ads on PapaScott reminds me of the <a href="http://www.youtube.com/watch?v=W-M3Q2zhGd4">Woody Allen joke</a> about his brother who thought he was a chicken. "Yes, we know we should take him to a psychiatrist, but we need the eggs."</p>'},next:{fields:{title:"Laryngitis",date:"25 Feb 2008",slug:"/2008-02-25-laryngitis/"}},previous:{fields:{title:"She Doesn't Fly Anymore",date:"03 Mar 2008",slug:"/2008-03-03-she-doesnt-fly-anymore/"}}},{node:{fields:{title:"Laryngitis",date:"25 Feb 2008",slug:"/2008-02-25-laryngitis/",tags:"Y2008"},html:"<p>Sorry I've so quiet here lately, it seems I've lost my voice. We've both been on the floor running shifts at work (one shift leader sick, another on holiday) and we've been doing what McDonald's insiders affectionately refer to as \"running labor\", i.e. running slightly understaffed to make up for previous shifts that were overstaffed in order to meet a goal for labor costs. It's kind of like sticking your feet in the oven when you're head is cold so that your average temperature is OK.</p>\n<p>Actually, I think the expression is \"sticking your head in the oven when your feet are cold\", but that made me think of <a href=\"http://en.wikipedia.org/wiki/Sylvia_Plath#Death\">Sylvia Plath</a>, and such a dire impression is not the one what I wanted to make.</p>\n<p>Whatever creative outbursts I've had have easily fit into the 140 character limit at Twitter. I'll try harder to be more creative in the future.</p>"},next:{fields:{title:"Pinko Commies",date:"17 Feb 2008",slug:"/2008-02-17-pinko-commies/"}},previous:{fields:{title:"We Need The Eggs",date:"01 Mar 2008",slug:"/2008-03-01-we-need-the-eggs/"}}}],pathPrefix:"",first:!1,last:!1,index:82,pageCount:1101}}}});
